import React from "react";
import { Link } from "@reach/router";

const ArticleCard = props => {
  return (
    <>
      <li>
        <Link to="/articles/:article_id">
          <p>{props.date}</p>
          <h4>{props.title}</h4>
          <p>{props.topic}</p>
        </Link>
      </li>
    </>
  );
};
export default ArticleCard;
